import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import {Image, 
        View
} from "react-native"
import {Home, Feeds, Catalog, News, Favorite} from "../screens";
import { COLORS, FONTS, icons, SIZES } from '../constant';
import react from 'react';

const Tab = createBottomTabNavigator();


function Tabs() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Releases" component={Home} options = {{
        tabBarIcon: ({focused}) => (
          <Image  source={icons.releases} resizeMode = "contain" style = {{height:35, width:35, tintColor: focused ? COLORS.black : COLORS.gray}} />
        ),headerShown: false
      }}  />
      <Tab.Screen name="Feeds" component={Feeds} options = {{
        tabBarIcon: ({focused}) => (
          <Image  source={icons.feeds} resizeMode = "contain" style = {{height:35, width:35, tintColor: focused ? COLORS.black : COLORS.gray }} />
        ),headerShown: false
      }} />
      <Tab.Screen name="Catalog" component={Catalog} options = {{
        tabBarIcon: ({focused}) => (
          <Image  source={icons.catalog} resizeMode = "contain" style = {{height:45, width:45, tintColor: focused ? COLORS.black : COLORS.gray }}/>
        ),headerShown: false
      }} />
      <Tab.Screen name="Favorite" component={Favorite} options = {{
        tabBarIcon: ({focused}) => (
          <Image  source={icons.favorite} resizeMode = "contain" style = {{height:35, width:35, tintColor: focused ? COLORS.black : COLORS.gray }}/>
        ),headerShown: false
      }} />
      <Tab.Screen name="News" component={News} options = {{
        tabBarIcon: ({focused}) => (
          <Image  source={icons.news} resizeMode = "contain" style = {{height:35, width:35, tintColor: focused ? COLORS.black : COLORS.gray }}/>
        ),headerShown: false
      }} />
    </Tab.Navigator>
  );
}
export default Tabs;
